import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import { Table } from "react-bootstrap";

const axios = require("axios");

// import { fetchUser } from "./data/fetchUsers";

export const User = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios("https://jsonplaceholder.typicode.com/users");
      setData(result.data);
      console.log(result.data);
    };
    fetchData();
  }, []);

  return (
    <div>
      <p>USER PAGE</p>

      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>email</th>
            <th>website</th>
            <th>company name</th>
          </tr>
        </thead>
        {data.map((user: any, index: number) => {
          return (
            <tbody>
              <tr>
                <td>1</td>
                <td>Mark</td>
                <td>Otto</td>
                <td>@mdo</td>
              </tr>
              <tr>
                <td>2</td>
                <td>Jacob</td>
                <td>Thornton</td>
                <td>@fat</td>
              </tr>
              <tr>
                <td>3</td>
                <td>@twitter</td>
              </tr>
            </tbody>
          );
        })}
      </Table>

      {/* {data.map((user: any, index: number) => {
        return (
          <div key={index} style={{ display: "flex", margin: 20 }}>
            <Link to={`/user/${user.id}`}>{user.name}</Link>
            <div>{user.email}</div>
            <div>{user.web}</div>
            <div>{user.company.name}</div>
          </div>
        );
      })} */}
      <p></p>
    </div>
  );
};
